import React from 'react';

import IntroImg from '../img/bg.jpg'

import "./HeroImgstyle.css";


const HeroImag = () => {
  return (
    <div className="hero">

        <div className="mask">
            <img className="int-img" src={IntroImg} alt="intoImg" />
        </div>

    </div>
  )
}

export default HeroImag
